INSERT INTO `pal_movie` VALUES(1, 'Los Vengadores', 'The Avengers', 'Marvel Studios presenta “Marvel Los Vengadores”, el equipo de super heroes mas espectacular de todos los tiempos con iconos como Iron Man, El Increible Hulk, Thor, Capitan America, Ojo de Halcon y Viuda Negra. Cuando un enemigo inesperado amenaza con poner en peligro la seguridad mundial, Nick Fury, Director de la agencia internacional para el mantenimiento de la paz, conocida con el nombre de SHIELD, necesita encontrar urgentemente un equipo que salve al mundo del mayor de los desastres.', '2012-05-05', '130', 1, 1, 'avengers-022812(1).jpg', 'avengers-022812.jpg', '', 'http://www.youtube.com/watch?v=jBsxJ4tod-Q', 4.50, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(2, 'Batalla Naval', 'Battleship', 'Aventura de accion que transcurre en el mar, el cielo y la tierra, en la que nuestro planeta lucha por sobrevivir contra una fuerza muy superior.\r\n\r\nBATTLESHIP esta protagonizada por TAYLOR KITSCH (X-Men origenes: Lobezno, John Carter) en el papel del teniente Hopper, un oficial de la Marina destinado al buque John Paul Jones; ALEXANDER SKARSGARD (la serie “True Blood/Sangre fresca”, Melancolia) como Stone, el hermano mayor de Hopper y capitan del barco Samson.', '2012-05-11', '131', 1, 0, '4107mub+xpl._sl500_aa300_.jpg', '4107mub+xpl._sl500_aa300_(1).jpg', '', 'http://www.youtube.com/watch?v=qDMXkPfxjOc', 0.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(3, 'Piratas una loca aventura', 'The Pirates! Band of Misfits', 'Piratas! Una loca aventura es la nueva y divertida comedia animada de los creadores de Wallace y Gromit abordo de un barco de piratas. Luego de más de veinte años recorriendo los siete mares, Capitán Pirata (Hugh Grant) un estusiasta sin límites que, con una tripulación de segunda y aparentemente ciego a las circustancias desfavorables en su contra, tiene un sueño: derrocar a sus amargos rivales Black Bellamy y Cutlass Liz decide desembarcar con su tripulación para postularse al premio más prest', '2012-05-19', '88', 5, 2, 'piratas_una_aventura.jpg', 'piratas_una_aventura_-_copia.jpg', '', 'http://www.youtube.com/watch?v=VZqSx2U7RPM', 0.00, '');
INSERT INTO `pal_movie` VALUES(4, 'Proyecto X', 'Project X', '“Project X” sigue a tres anónimos estudiantes del último curso del instituto que quieren darse a conocer. Su idea es inocente: vamos a montar una fiesta que nadie pueda olvidar... pero nada podía prepararles para esta fiesta. Las noticias corren como la pólvora y arruinan sueños, manchan el historial de las personas y nacen leyendas. "Project X" es un aviso a los padres y a la policía de todas partes.', '2012-05-11', '88', 3, 0, 'proyecto_x.jpg', 'proyecto_x_s.jpg', '', 'http://www.youtube.com/watch?v=kwd5aP-NkCY', 0.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(5, 'Madam Butterfly 3D', 'Madam Butterfly 3D', 'La historia de amor de una geisha japonesa con un oficial de la marina estadounidense llevó a Giacomo Puccini a componer música de rara belleza, sensualidad y una potencia desgarradora, mientras la tragedia de Butterfly se desarrolla hasta sus últimas consecuencias devastadoras.', '2012-05-13', '150', 7, 2, '4670gr.jpg', '4670gr(1).jpg', '', 'http://www.youtube.com/watch?v=sLcbfF9ypmM', 0.00, '');
INSERT INTO `pal_movie` VALUES(6, 'Blancanieves, Espejito Espejito', 'Mirror, Mirror', 'Nueva versión del cuento de Blancanieves en el que la malvada madrastra de la princesa (Julia Roberts) tratará por todos los medios de destruir el reino. Sin embargo, Blancanieves y sus siete eternos compañeros de batalla estarán allí para evitar que eso suceda.', '2012-05-04', '106', 3, 0, 'florence-breath-of-life1.jpg', 'florence-breath-of-life1(1).jpg', '', 'http://www.youtube.com/watch?v=vbPs3wUcXEU', 2.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(7, 'Los pitufos', 'The smurfs', 'Es la pelicula de los pitufos', '2012-05-25', '130 min', 3, 1, 'los-pitufos-fotos.jpg', 'los-pitufos-fotos.jpg', '', 'http://youtube.com', 0.00, '');
INSERT INTO `pal_movie` VALUES(8, 'Mi vida con Mario', 'MI VIDA CON MARIO', 'TODO COMENZO HACE CASI 10 A;OS.......', '2012-05-24', '119', 7, 1, 'img_0511.jpg', 'img_0517.jpg', '', 'WWW.YOUTUBE.COM/JDKFAJD938', 0.00, '');
INSERT INTO `pal_movie` VALUES(9, 'Hombres de Negro III', 'MIB III', 'Los Hombres de Negro tienen como funcion confundir o amedrentar a investigadores y testigos de OVNIs y visitantes extraterrestres, ademas de confiscar supuestas evidencias de presencia alienigena, con el proposito de preservar del conocimiento publico las visitas de extraterrestres a nuestro planeta. Esta vez la historia comenzara en la actualidad para pasar despues al 1969, con Will Smith como el Agente J viajando en el tiempo para conocer a un joven Agente.', '2012-05-25', '100', 1, 1, 'images_(2).jpg', 'images_(2)_-_copy.jpg', '', 'http://www.youtube.com/watch?v=X9ACTM-LxXA', 5.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(10, 'Toque de Queda', 'Toque de Queda', 'Se centra en los acontecimientos de esa fecha. Esa noche, tres personajes huyen de la prohibición de circular por las calles, y se encuentran en una casa del centro de Tegucigalpa donde, por alguna razón, comienza un enfrentamiento entre ellos, dando inicio a la historia.', '2011-05-11', '100', 2, 2, 'toque.jpg', 'toque_(1).jpg', '', 'http://www.youtube.com/watch?v=q7pGAgFQFKI', 0.00, '');
INSERT INTO `pal_movie` VALUES(11, 'Madagascar 3', 'Madagascar 3', 'En “Madagascar 3: De marcha por Europa”, nuestros amigos Alex el leon, Marty la cebra, Melman la jirafa y Gloria la hipopotamo se encontraran de aventuras en el viejo continente, tratando de escapar de una funcionaria de control de animales que intentara capturarlos para asi llevarlos al zoologico de Nueva York. En esta tercera entrega de la saga apareceran nuevos personajes pertenecientes a razas de distintos lugares del planeta, caso de un leon marino italiano, un tigre ruso y un jaguar.', '2012-06-08', '93', 5, 1, 'madagascar__3.jpg', 'madagascar__3_-_copy.jpg', '', 'http://www.youtube.com/watch?v=DvnMXhCZ71E', 4.75, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(12, 'Comando Especial', '21 Jump Street', 'En una entrevista Jonah Hill comento: "No se trata de una parodia de la serie televisiva, ni yo voy a interpretar el papel de Johnny Depp. Simplemente sera un grupo de personas que volveran a la secundaria por algun que otro problema de drogas. Tampoco sera algo muy serio como Miami Vice, mas bien sera una comedia entretenida con algo de accion."', '2012-06-08', '109', 3, 1, 'comando-especial-pelicula-300x300.jpg', 'comando-especial-pelicula-300x300_-_copy.jpg', '', 'http://www.youtube.com/watch?v=XzkEwkftQ8o', 5.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(13, 'Prometeo', 'Prometheus', 'En Prometheus un grupo de exploradores descubre una pista de los origenes de la humanidad en la Tierra. Ellos emprenderan un trepidante viaje a los rincones mas oscuros del universo. Alli deberan luchar en una terrible batalla para salvar el futuro de la raza humana', '2012-06-15', '125', 1, 1, 'prometeo-prometheus-resena_-_copia.jpg', 'prometeo-prometheus-resena.jpg', '', 'http://www.youtube.com/watch?v=TWPbhgJQCqc', 4.75, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(14, 'American Pie El Reencuentro', 'American Pie', 'Los personajes de ''American Pie'' vuelven a reunirse diez años despues para acudir a un evento para antiguos alumnos del instituto. En los años que han pasado, Jim (Jason Biggs, ''Todo lo demas'') y Michelle (Alyson Hannigan, ''Como conoci a vuestra madre'') se casaron mientras que Kevin (Thomas Ian Nicholas, ''Las reglas del juego'') y Vicky (Tara Reid, ''El gran Lebowski'') se separaron; Oz (Chris Klein, ''Election'') y Heather (Mena Suvari, ''American Beauty''), tambien, mientras Finch (Eddie Kaye Thomas)', '2012-06-22', '112', 3, 1, 'american_pie_el_reencuentro-715462268-large.jpg', 'american-pie-el-reencuentro..jpg', '', 'http://www.youtube.com/watch?v=DxBxqbsGlK0', 4.50, 'Mayores de 18');
INSERT INTO `pal_movie` VALUES(15, 'La Era de Hielo 4', 'Ice Age: Continental Drift', 'La persecucion descabellada de Scrat de la bellota maldita, la que ha estado persiguiendo desde el principio de los tiempos, tiene consecuencias que van a cambiar el mundo – un cataclismo continental que desencadena la mayor aventura de todas para Manny, Diego y Sid. En la estela de esta conmocion, Sid se rencuentra con su refunfuñona abuelita, y la manada tropieza con una coleccion de desaliñados piratas marineros decididos a impedir su regreso a casa', '2012-06-29', '87', 5, 1, 'iceage_afiche.jpg', '4760gr.jpg', '', 'http://www.youtube.com/watch?v=NV3vLRyw8eQ', 4.25, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(16, 'El Sorprendente Hombre Araña', 'The Amazing Spider Man', 'Parker (Andrew Garfield) vuelve a la secundaria... Spiderman inicia! Como la mayoria de los adolescentes de su edad, Peter trata de averiguar quien es y cómo llego a ser la persona que es actualmente. En su jornada por reunir todas las piezas de su pasado descubre un secreto que su padre tenía...un secreto que en última instancia da forma a su destino como Hombre Araña. Esta es la primera de una serie de peliculas que cuenta un lado diferente de la historia de Peter Parker.', '2012-07-06', '137', 5, 1, 'amazing_spiderman_poster.jpg', 'amazing_spiderman_poster_-_copia.jpg', '', 'http://www.youtube.com/watch?v=WwsoSHh23Ds', 5.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(17, 'El Principe del Desierto', 'El Principe del Desierto', 'Bajo el implacable cielo del desierto, dos lideres se enfrentan en una guerra. El victoriso Nesib, Emir de Hobeika, le establece los terminos de paz a su Rival Amar, Sultan de Samaah. Los dos acuerdan que ninguno podra tener derecho a la tierra de nadie, llamada La Franja Amarilla.A cambio, Nesib adopta los dos hijos de Amar: Saleeh y Auda, como garantia de que ninguno podia invadir al otro. Doce años despues, Saleeh y Auda ya son unos jovencitos.', '2012-07-13', '130', 2, 1, 'el_pri118032012.jpg', 'el_pri118032012_-_copia.jpg', '', 'http://www.youtube.com/watch?v=5AobduI8_PU', 3.50, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(18, 'Sombras Tenebrosas', 'Dark Shadows', 'Pasan dos decadas y Barnabas (Johnny Depp) tiene el mundo a sus pies, o por lo menos la ciudad de Collinsport, Maine. Barnabas, el amo de Collinwood Manor, es rico, poderoso y un mujeriego impenitente... hasta que comete el grave error de romperle el corazon a Angelique Bouchard (Eva Green). Angelique, una bruja en toda la extension de la palabra, le condena a un destino peor que la muerte: le convierte en vampiro y le entierra vivo.', '2012-07-20', '102', 10, 1, 'sombras_tenebrosas.jpg', 'sombras_tenebrosas_-_copia.jpg', '', 'http://www.youtube.com/watch?v=JXtyOfg3l_c', 4.50, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(19, 'Batman, El caballero de la noche asciende', 'Batman the dark knight rises', 'En Batman El caballero de la noche asciende han pasado ocho anios desde que Batman desaparecio en la oscuridad de la noche, momento a partir del cual se transformo de heroe en fugitivo. Al asumir la culpa por la muerte del fiscal Harvey Dent, El caballero de la noche sacrifico todo por lo que el y el comisionado Gordon esperaban fuera el bien mayor. El enganio funciono durante un tiempo, ya que se redujo dramaticamente el crimen en Gotica bajo el peso de la ley Dent.', '2012-07-27', '164', 4, 1, 'copia_de_batman-caballero-noche-asciende.jpg', 'batman-caballero-noche-asciende.jpg', '', 'http://www.youtube.com/watch?v=Kkziu0lzUmw', 4.88, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(20, 'La Dama de Negro', 'The Woman in Black', 'En La dama de negro un joven abogado londinense, Arthur Kipps (Daniel Radcliffe), se ve obligado a dejar a su hijo de tres años para viajar a Crythin Gifford, un pueblo en el que el tiempo parece haberse detenido. Va a ocuparse de los asuntos de un cliente recientemente fallecido, propietario de la mansión Eel Marsh, pero cuando llegue a la casa, tan antigua como escalofriante, se encontrará con algo inesperado. Mientras trabaja en el solitario lugar, Kipps comienza a descubrir secretos trágicos', '2012-08-03', '95', 6, 1, 'revista2_copy_-_copy.jpg', 'revista2_copy.jpg', '', 'http://www.youtube.com/watch?v=TrYaG5VWXtw', 3.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(21, 'Cuando te Encuentre', 'The Lucky One', 'Cuando te encuentre, Logan Thibault (Zac Efron) es un Sargento de la Marina de EEUU quien en el medio de un combate encuentra la foto de una mujer. Esa foto le trae suerte (el título original del film en castellano es “El afortunado”) y regresa con vida a su casa cuando otros no lograron sobrevivir. Al terminar la guerra Logan decide buscar a la mujer de la foto que le salvó la vida. Cuando finalmente se encuentra con Beth (Taylor Schilling) no puede decirle la verdad y acepta trabajar en su cri', '2012-08-03', '101', 2, 1, 'mv5bmtg5ndk3mjazmf5bml5banbnxkftztcwmjuynzexnw@@._v1._sy317__-_copy.jpg', 'mv5bmtg5ndk3mjazmf5bml5banbnxkftztcwmjuynzexnw@@._v1._sy317_.jpg', '', 'http://www.youtube.com/watch?v=itSHshh34Ws', 4.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(22, 'El Vengador del Futuro', 'Total Recall', 'El vengador del futuro es la remake de la legendaria pelicula del año 1990 que tenía a Arnold Schwarzenegger y Sharon Stone como sus principales protagonistas. En esta oportunidad su director Len Wiseman (Duro de matar 4) ya comienza a darle forma a las distintas tomas. Como te hemos contado antes los protagonistas en esta oportunidad son Colin Farrell, Kate Beckinsale, Jessica Biel y Bill Nighy.', '2012-08-10', '118', 4, 1, 'el_vengador_del_futuro_2012.jpg', 'el_vengador_del_futuro_2012_-_copia.jpg', '', 'http://www.youtube.com/watch?v=ayJmz9FitjA', 3.50, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(23, 'Siempre el Mismo dia', 'One Day', '“One day (Siempre el mismo día)” nos cuenta la extraordinaria relación entre Emma (Anne Hathaway) y Dexter (Jim Sturgess). Se conocen la noche de su graduación en la universidad, el 15 de julio de 1988. Emma es una chica de clase trabajadora con principios y ambición que sueña con mejorar el mundo. Dexter es un donjuán acomodado que sueña con convertir el mundo en su sala de juegos. Durante los siguientes 20 años, volvemos a encontrar a “Em” y a “Dex” y vemos cómo su amistad se debilita o se ref', '2012-08-10', '107', 2, 1, 'one-day--120175_-_copia.jpg', 'one-day--120175.jpg', '', 'http://www.youtube.com/watch?v=v7mL_GZM98Y', 0.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(24, 'Valiente', 'Valiente', 'En Valiente (Brave), las acciones de Mérida desatan el caos y la furia en el reino, y cuando ella acude a una anciana y excéntrica adivina en busca de ayuda, lo único que se le concede es un deseo malogrado. El consecuente peligro la forzará a descubrir el real significado de la valentía, una virtud que necesitará para deshacer una bestial maldición antes de que sea demasiado tarde.', '2012-08-17', '105', 5, 1, 'valiente-300x300.jpg', 'valiente-300x300_-_copia.jpg', '', 'www.youtube.com/watch?v=L7vgxx5gGKo', 4.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(25, 'De Roma con Amor', 'De Roma con amor', 'Comedia que transcurre en una de las ciudades más encantadoras del mundo, Roma. La película narra cuatro historias independientes: la de un renombrado arquitecto americano que está reviviendo su juventud; la de un típico romano de clase media que, de repente, se encuentra asimismo siendo la mayor celebridad de Roma; la de una pareja de provincianos involucrados en diferentes encuentros románticos; y la de un director de ópera americano que está tratando de llevar a un agente funerario al escenar', '2012-08-17', '111', 3, 1, 'c_4758gr.jpg', 'c_4758gr_-_copia.jpg', '', 'http://www.youtube.com/watch?v=gQuI3D98ub0', 0.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(26, 'El Legado de Bourne', 'The Bourne Legacy', 'En El legado de Bourne aparece el personaje de Aaron Cross, uno de los seis agentes secretos creados por el programa Outcome del Departamento de Defensa, que han sido diseñados para funcionar en solitario en misiones altamente arriesgadas de larga duración. El estudio del comportamiento que dio pie al programa Treadstone ha evolucionado mucho, pero dado que ambos programas comparten el mismo origen, Outcome se convierte en un peligro cuando la historia de Bourne pasa al dominio público.', '2012-08-24', '133', 4, 1, 'el_legado_bourne_afiche_-_copia.jpg', 'el_legado_bourne_afiche.jpg', '', 'http://www.youtube.com/watch?v=4L1wIuyNY78', 2.25, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(27, 'Votos de Amor', 'The Vow', 'Votos de amor cuenta la historia real de una pareja de recién casados de Nuevo Mexico, que tiene un accidente de coche a consecuencia del cual la esposa (Rachel McAdams) entra en coma. El marido (Channing Tatum) cuida de ella noche y día, y cuando por fin ella despierta habiendo perdido totalmente la memoria, él intenta reconquistarla y ganarse de nuevo su corazón.', '2012-08-24', '104', 2, 1, 'votos-de-amor_-_copia.jpg', 'votos-de-amor.jpg', '', 'http://www.youtube.com/watch?v=Me--06Z_M6U', 4.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(28, 'Abraham Lincoln: Cazador de vampiros', 'Abraham Lincoln: Vampire Hunter', 'Abraham Lincoln: Vampire Hunter nos adentra en el diario secreto del presidente más famoso de los Estados Unidos, y cómo se convirtió en un soldado que hacía frente a las fuerzas de la oscuridad.', '2012-08-31', '105', 10, 1, 'cazador_de_vampiros_abraham_lincoln.jpg', 'cazador_de_vampiros_abraham_lincoln_-_copia.jpg', '', 'http://www.youtube.com/watch?v=6Wf6Io9Ji0M', 5.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(29, 'El Dictador', 'The Dictator', 'El tirano dictador islámico General Almirante Aladeen, viaja a los Estados Unidos para una reunión de las Naciones Unidas, con el fin de explicar la fabricación de armas nucleares en su régimen. Allí será secuestrado y reemplazado por un doble que firmará “la democracia” en su país. El dictador deambulará por las calles de norteamérica, imprimiendo su particular estilo de vida, mientras intenta recuperar el poder de su región.', '2012-08-31', '83', 3, 1, 'eldictadorafiche.jpg', 'eldictadorafiche_-_copia.jpg', '', 'http://www.youtube.com/watch?v=uZXOD3Tm67g', 4.50, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(30, 'ParaNorman', 'ParaNorman', 'En un pueblo se ve asediado por los zombis. ¿A quién pueden recurrir los habitantes? Tan sólo al incomprendido Norman, un joven del pueblo que sabe hablar con los muertos. Además de zombis, deberá enfrentarse a brujas y, peor aún, a unos adultos retrasados, si quiere salvar a su pueblo de una maldición lanzada hace siglos. Pero este joven “susurrador” de fantasmas verá sus actividades paranormales empujadas hacia límites de otro mundo.', '2012-09-07', '92', 5, 1, '51n4n-pad4l._sl500_aa300__-_copia.jpg', '51n4n-pad4l._sl500_aa300_.jpg', '', 'http://www.youtube.com/watch?v=1NbtltCSpcU', 1.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(31, 'Al Borde del Abismo', 'Man on a Ledge', 'En Al borde del abismo un ex policía amenaza con suicidarse saltando desde la azotea de un hotel en Manhattan. Se moviliza la policía de New York enviando una psicóloga para negociar con él. Sin embargo, todos desconocen que se trata de una distracción para poder practicar el robo de diamantes más grande jamás realizado.', '2012-09-07', '102', 9, 1, 'al-borde-del-abismo_-_copia.jpg', 'al-borde-del-abismo.jpg', '', 'http://www.youtube.com/watch?v=va4lSBdOwKA', 4.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(32, 'Mini Espias 4', 'Spy Kids: All the Time in the World in 4D', 'Un maníaco conocido como Timekeeper amenaza con apoderarse del planeta y ella es llamada por el jefe de la OSS, el hogar donde fue criada como una espía cuando era niña. Con Armageddon acercándose rápidamente, Rebecca y Cecil se ven empujados a la acción cuando se enteran que su aburrida madrastra fue una vez una superagente, y tendrán que dejar a un lado sus diferencias para combatir el mal. Ellos recibirán una pequeña ayuda de un par de mini espías, Carmen y Juni Cortez. Sólo así podrán salvar', '2012-09-07', '90', 1, 1, 'mini_espias_4_-_copia.jpg', 'mini_espias_4.jpg', '', 'http://www.youtube.com/watch?v=qn59lV9rSF8', 4.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(33, 'Resident Evil 5: La Venganza', 'Resident Evil: Retribution', 'Jill Valentine, una de las mejores policias de Raccoon City, de S.T.A.R.S., se convierte en vicepresidenta de Umbrella 10 anos despues. Ahora, Alice no solo debe derrotar a Umbrella, sino que tambien debe recuperar a Jill y mantener a salvo a la tripulacion del barco Arcadia y descubrir como su sangre es la cura para el virus-T y usarla.', '2012-09-14', '95', 1, 1, 'resident_evil_5_0_-_copia.jpg', 'resident_evil_5_0.jpg', '', 'http://www.youtube.com/watch?v=keVDB537AXM', 2.25, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(34, 'Inmortales', 'Immortals', 'En Inmortales, el brutal y sanguinario Rey Hyperion y su ejercito asesino, recorren Grecia en busca del arco perdido de Epiro. Con ese invencible arco, el Rey Hyperion sera capaz de derrocar a los dioses del Olimpo y convertirse en el ser mas poderoso del Universo.', '2012-09-14', '110', 2, 1, 'inmortales_afiche2_-_copia.jpg', 'inmortales_afiche2.jpg', '', 'http://www.youtube.com/watch?v=wTFgdjjqw-M', 4.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(35, 'Ted', 'Ted', 'Ted se centra en la historia de un hombre adulto quien posee un osito de peluche que cobro vida como resultado de un deseo de infancia y nunca ha salido de su lado.', '2012-09-21', '105', 3, 1, 'ted_0_-_copia.jpg', 'ted_0.jpg', '', 'http://www.youtube.com/watch?v=6hDgDN7z7Rs', 5.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(36, 'No le temas a la Oscuridad', 'Don''t be afraid of the dark', 'El film, remake de una serie televisiva de los años 70, trata sobre una niña que junto a su padre y la novia de éste estrenan casa, una vieja mansión, sin saber que en sus sótanos anidan criaturas diabólicas, a las que liberan al realizar obras de reacondicionamiento del edificio.', '2012-09-21', '98', 6, 1, 'noletemasalaoscuridad_-_copia.jpg', 'noletemasalaoscuridad.jpg', '', 'http://www.youtube.com/watch?v=_-dyyIzORNs', 1.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(37, 'Buscando a Nemo', 'Finding Nemo', 'El pececillo Nemo, que es hijo unico, es muy querido y protegido por su padre. Despues de ser capturado en un arrecife australiano va a parar a la pecera de la oficina de un dentista de Sidney. Su timido padre emprendera una peligrosa aventura para rescatarlo. Pero Nemo y sus nuevos amigos tienen tambien un astuto plan para escapar de la pecera y volver al mar.', '2012-09-28', '100', 5, 1, 'fff.jpg', '1348772080_2389_finding-nemo-3d-pal_movie-poster-e1347559557451-300x300.jpg', '', 'http://www.youtube.com/watch?v=SV99gv5s8QM', 3.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(38, 'Ese es mi Hijo', 'That`s my boy', 'Un hombre (Adam Sandler) pretende controlar la inminente boda de su hijo (Andy Samberg), y para ello se muda a vivir con el y su novia (Leighton Meester).', '2012-09-28', '115', 3, 1, 'thats-my-boy-soundtrack_(1).jpg', 'thats-my-boy-soundtrack.jpg', '', 'http://www.youtube.com/watch?v=S5m0T_gN0oo', 3.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(39, 'La Era del Rock', 'Rock of Ages0', 'Adaptacion cinematografica del musical homonimo. Los Angeles, 1987. Un aspirante a roquero y una chica que trabajan en el mismo club se enamoran y tratan de impedir que el local caiga en manos de unos empresarios que quieren demolerlo.', '2012-09-28', '120', 8, 1, 'poster-la-erasliderrr-300x300.jpg', 'poster-la-erasliderrr-300x300_-_copia.jpg', '', 'http://www.youtube.com/watch?v=SqtiJ9L4PoM', 0.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(40, 'Solo por Dinero', 'One for the Money', 'Stephanie Plum no esta precisamente en racha. A su edad de 30 acaba de salir de un divorcio, la han despedido y vive con su hamster en Trenton (Nueva Jersey). Sin blanca y desesperada, empieza a trabajar para un rastrero primo suyo, que es agente de fianzas. La urgente necesidad de conseguir dinero la lleva a encargarse de un caso muy dificil: la busqueda de un policia local acusado de asesinato, que resulta ser el chico del que se enamoro en el instituto. La investigacion acaba arrastrandola al', '2012-09-28', '105', 4, 1, 'images.jpg', 'images_-_copia.jpg', '', 'http://www.youtube.com/watch?v=-S79I78arQQ', 0.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(41, 'Chimpances', 'Chimpanzee', 'Documental sobre una familia de chimpancés que vive en Costa de Marfil.', '2012-10-05', '80', 12, 1, 'chimpances-1_-_copia.jpg', 'chimpances-1.jpg', '', 'http://www.youtube.com/watch?v=UnM9FCYpoNI', 0.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(42, 'La Mascara de Muerte 4', 'Scream 4', 'Cuarta entrega de la popular saga de terror "Scream". Sidney Prescott ha logrado olvidar los asesinatos cometidos en Woodsboro. Diez años después, convertida en una escritora de éxito, vuelve a su pueblo natal con motivo de la gira de promoción de su nuevo libro. Pero su regreso ira acompanado de una nueva ola de crimenes perpetrados por un viejo conocido: Ghostface.', '2012-10-05', '110', 6, 1, '4200gr.jpg', '4200gr.jpeg', '', 'http://www.youtube.com/watch?v=P5ksQaq1aGo', 0.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(43, 'El Artista', 'The Artist', 'Hollywood, 1927. George Valentin es una gran estrella del cine mudo a quien la vida le sonrie. Pero, con la llegada del cine sonoro, su carrera corre peligro de quedar sepultada en el olvido. Por su parte, la joven actriz Peppy Miller, que empezo como extra al lado de Valentin, se convierte en una estrella del cine sonoro.', '2012-10-05', '100', 2, 1, '45881_-_copia.jpg', '45881.jpg', '', 'http://www.youtube.com/watch?v=cbN9IMFuDrk', 0.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(44, 'Frankenweenie', 'Frankenweenie', 'Frankenweenie utilizara la tecnica stopmotion que se basa en el cortometraje homonimo de 1984 dirigido en accion real por el propio cineasta para Disney. Frankenweenie cuenta la historia de un nino que hace revivir a su perro, convirtiendolo en una suerte de Frankenstein.', '2012-10-12', '90', 5, 1, 'frankenweenie-unleashed_-_copia.jpg', 'frankenweenie-unleashed.jpg', '', 'http://www.youtube.com/watch?v=IaaoxAxygXQ', 4.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(45, 'El Xendra', 'El Xendra', 'La pelicula cuenta la historia de cuatro investigadores centroamericanos que son convocados por el gobierno de Honduras para indagar sobre eventos paranormales en una zona de La Mosquitia, ellos descubre mediante un mensaje extraterrestre un mensaje que los lleva a Ciudad Blanca.', '2012-10-12', '110', 1, 1, '3885917_300_-_copia.jpg', '3885917_300.jpg', '', 'http://www.youtube.com/watch?v=HyH2XbNVHiM', 2.50, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(46, 'Solo Una Noche', 'Last Night', 'Relato de amor, traición y celos. Un matrimonio de Nueva York tiene que separarse, durante una noche, por causa de un viaje de negocios que el marido (Worthington) debe realizar con una atractiva compañera de trabajo (Eva Mendes). Mientras tanto, su esposa (Keira Knightley) se reencuentra con Alex (Guillaume Canet), un antiguo amor.', '2012-10-12', '90', 2, 1, 'solo-una-noche1-300x300_-_copia.jpg', 'solo-una-noche1-300x300.jpg', '', 'http://www.youtube.com/watch?v=o_Wo8Zkeecs', 0.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(47, 'Actividad Paranormal 4', 'Paranormal Activity 4', 'La cuarta parte de la saga continua la historia regresando al presente para retratar acontecimientos posteriores a los primeros dos filmes en los que las hermanas Katie y Kristi eran perseguidas por un malevolo espiritu. En esta ocasion la protagonista sera una adolescente llamada Alice cuya familia comienza a experimentar acontecimientos extranos en coincidencia con la llegada de nuevos vecinos entre los que se hallan un misterioso nino pequeno.', '2012-10-19', '90', 6, 1, '4923gr_-_copia.jpg', '4923gr.jpg', '', 'http://www.youtube.com/watch?v=fq1xg8T8cSE', 5.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(48, 'Los Indestructibles', 'The Expendables 2', 'En Los indestructibles 2 la historia se traslada a Albania, a donde los indestructibles se dirigen en una supuesta mision sencilla encargada por el Sr Church (Bruce Willis) Una vez en el lugar uno de la banda comandada por Barney (Sylvester Stallone), el mas joven y tierno de todos algo que no cuadra en el grupo muere en manos de una tropa comando liderada por el villano Vilain (Jean Claude Van Damme, el malo de la pelicula), que se encuentran en la zona explotando una mina para extraer petroleo', '2012-10-19', '105', 4, 1, '48251_-_copia.jpg', '48251.jpg', '', 'http://www.youtube.com/watch?v=gI_EFisfx3w', 5.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(49, 'Salvajes', 'Savages', 'Salvajes, dirigida por Oliver Stone, se centra sobre dos narcotraficantes que trabajan para una organizacion que secuestra a su joven amiga. Laguna Beach, ese rutilante centro turistico costero en el Condado de Orange, California, es el hogar de los privilegiados y los aburridos: adolescentes con demasiado tiempo libre e ingresos disponibles, lo mismo que hombres y mujeres que se mantienen perpetuamente jovenes con la ayuda de un abundante numero de cirujanos plasticos – todos realizando un pere', '2012-10-26', '130', 9, 1, 'savages-soundtrack-list_-_copia.jpg', 'savages-soundtrack-list.jpg', '', 'http://www.youtube.com/watch?v=fbJWVYLpZ1k', 0.00, 'Mayores de 18');
INSERT INTO `pal_movie` VALUES(50, '2012: El Principio', '2012 The Beginning', '21 de diciembre 2012. Esta fecha, identificada por los mayas casi 1.400 años atras, en los ultimos anos se ha convertido en la fuente de gran curiosidad y debate. Algunos creen que traera eventos catastroficos. Otros, una era de iluminacion. Pero, ¿que creian los antiguos mayas? En 2012: EL PRINCIPIO, viajamos por el mundo para examinar lo que los textos sagrados mayas realmente dicen. A lo largo de nuestro recorrido es guiado por los arqueologos se ha senalado, los eruditos y los mayas vivos, q', '2012-10-26', '60', 12, 1, '59006_-_copia.jpg', '59006.jpg', '', 'http://www.2012thebeginning.com/', 0.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(51, 'Temporada de Brujas', 'Season of the Witch', 'A mediados del siglo XIV, el caballero Lavey (Nicolas Cage) escolta hasta un monasterio a una joven acusada de brujeria. Los monjes aseguran que ella es la responsable de que la Peste Negra asole y destruya Europa. Lavey, esceptico, no acepta esta explicacion y con un grupo de bravos guerreros emprende un viaje para demostrar la inocencia de la joven, pero el azar los conducira a un lugar donde les esperan las fuerzas de la oscuridad.', '2012-10-26', '95', 6, 1, 'season-of-the-witch-advance-mini-pal_movie-poster_-_copia.jpg', 'season-of-the-witch-advance-mini-pal_movie-poster.jpg', '', 'http://www.youtube.com/watch?v=ov2LzWwFBRQ', 0.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(52, 'Nacidos para Matar', 'Killer Elite', 'Tres antiguos miembros de las fuerzas especiales son contratados por un jeque arabe para matar a tres miembros del SAS (Servicio Especial Aereo britanico), culpables de la muerte de tres de sus hijos durante unos disturbios en Oman diez años antes. Dos de ellos aceptan el trabajo por dinero, pero el tercero (Jason Statham) lo hace para salvar la vida de un amigo. La mision es muy peligrosa y no será nada facil llevarla a cabo, pues los tres estan bajo el control de una organizacion formada por a', '2012-10-26', '115', 4, 1, '51i+-iaynwl._sl500_aa300__-_copia.jpg', '51i+-iaynwl._sl500_aa300_.jpg', '', 'http://www.youtube.com/watch?v=YkZOosgGr-A', 0.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(53, 'El Cuervo', 'The Raven', 'Los cuentos macabros y espeluznantes de Edgar Allan Poe cobran vida, y muerte, en este thriller protagonizado por John Cusack como el desdichado escritor. Cuando un loco, inspirado en las obras mas oscuras de Poe, empieza a cometer asesinatos horrorosos, un joven detective de Baltimore se une al escritor en una misión para entrar a la mente del asesino con el fin de impedir que siga convirtiendo cada una de estas brutales fantasías en una realidad escalofriante. Se produce un juego mortal que se', '2012-10-26', '109', 13, 1, '5311-4884-large_-_copia.jpg', '5311-4884-large.jpg', '', 'http://www.youtube.com/watch?v=XOWvoW3_Izo', 0.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(54, 'Operacion Skyfall 007', 'Skyfall', 'La lealtad del mejor agente de los servicios britanicos, James Bond (Daniel Craig), hacia su superiora M (Judi Dench) se vera seriamente puesta a prueba cuando el pasado de ella vuelve para atormentarla. El MI6 sufre un ataque, y 007 debe localizar y destruir la amenaza, liderada por el villano Silva (Javier Bardem), y en la que contara con la ayuda de la agente Eve (Naomie Harris).', '2012-11-01', '145', 4, 1, 'skyfall-0072-300x300_-_copia.jpg', 'skyfall-0072-300x300.jpg', '', 'http://www.youtube.com/watch?v=YvV3g8hLlyU', 4.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(55, 'Step Up 4: La Revolucion', 'Step Up 4', 'La historia se centra en una joven "nina de papa", que se enamora del lider de un grupo de baile que organiza flashmobs por amor al arte. Cuando el padre de esta quiere demoler el barrio donde viven los bailarines, la chica insta sus companeros de baile a que utilicen los flashmobs para reivindicar. Nueva entrega de la saga Step Up.', '2012-11-01', '100', 3, 1, 'step-up-revolution_-_copia.jpg', 'step-up-revolution.jpg', '', 'http://www.youtube.com/watch?v=aPVA84Y52x0', 3.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(56, 'Tinkerbell y el Secreto de las Hadas', 'Tinkerbell and the Secret of Wings', 'Ultima de las cuatro peliculas realizadas por los estudios DisneyToon, cuya protagonista es Campanilla, personaje de la novela "Peter Pan".', '2012-11-09', '90', 11, 1, 'tinker_-_copia.jpg', 'tinker.jpg', '', 'http://www.youtube.com/watch?v=BaxmZ7l7paQ', 4.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(57, 'Fin del Turno', 'End of Watch', 'Los agentes Taylor (Jake Gyllenhaal) y Zavala (Michael Pena) son dos policias de Los Angeles que patrullan las calles y que tendran que superar su mayor reto cuando se convierten en el objetivo de una peligrosa banda de narcotraficantes que han puesto precio a su cabeza.', '2012-11-09', '110', 1, 1, 'endof_-_copia.jpg', 'endof.jpg', '', 'http://www.youtube.com/watch?v=3ojGwt07-u8', 2.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(58, 'Locos por los votos', 'The Campaign', 'En Carolina del Norte, dos aspirantes a la presidencia de los Estados Unidos se enfrentan en campana electoral. Para el congresista Cam Brady (Will Ferrell) es la primera vez en su carrera que tiene que hacer frente a otro candidato: Marty Huggins (Zach Galifianakis), inconsciente titere de las grandes empresas y gerente de la oficina de turismo local.', '2012-11-09', '85', 3, 1, 'the-campaign-baby-poster_400x600.jpg', 'the-campaign-pal_movie-poster-e1351665899461-300x300.jpg', '', 'http://www.youtube.com/watch?v=bNv4hSCnOB0', 4.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(59, 'Dredd', 'Dredd', 'En un futuro cercano, Norteamerica se ha convertido en un paramo asolado por la radiactividad. Una unica y gran megalopolis se extiende a lo largo de la costa este: Mega City 1. Esta inmensa y violenta urbe cuenta con una poblacion de mas de 400 millones de personas, cada una de las cuales es un infractor en potencia. Los encargados de acabar con el caos e imponer el orden son unos individuos que actuan a la vez como agentes de la ley, jueces, jurados y verdugos. Al frente de ellos esta Dredd (K', '2012-11-16', '95', 13, 1, 'dreadd-300x300-2012-09-21_-_copia.jpg', 'dreadd-300x300-2012-09-21.jpg', '', 'http://www.youtube.com/watch?v=O1Jnaf-_7lQ', 3.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(60, 'La aparicion', 'The Apparition', 'Una joven pareja vive obsesionada a causa de una presencia sobrenatural, fruto de un experimento realizado en un colegio. Felton interpreta a un experto en fenomenos paranormales.', '2012-11-16', '85', 6, 1, 'la-aparicion-the-apparition-thumb_-_copia.jpg', 'la-aparicion-the-apparition-thumb.jpg', '', 'http://www.youtube.com/watch?v=SnwprB3TQak', 2.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(61, 'Amanecer 2', 'Breaking Dawn', 'Tras convertirse en vampiro, Bella debe adaptarse a su nueva naturaleza. Cuando nace Renesmee, la familia Cullen tendra que protegerse de la amenaza de los Volturi, pues existe una ley que prohibe transformar a los ninos en vampiros, ya que son dificiles de controlar y pueden provocar desastres que pongan en peligro la secreta existencia de los vampiros. Segunda parte de "Amanecer" y quinta entrega de la franquicia cinematografica Crepusculo, basada en las novelas de Stephenie Meyer.', '2012-11-23', '115', 7, 1, 'copia_de_breaking-dawn-part-2-soundtrack-art-300x300.jpeg', 'breaking-dawn-part-2-soundtrack-art-300x300.jpeg', '', 'http://www.youtube.com/watch?v=vGySfsgL4ug', 4.75, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(62, 'El Origen de los Guardianes', 'Rise of the Guardians', 'Los Guardianes Inmortales son un grupo de heroes que poseen extraordinarias facultades. Cuando Pitch, un espiritu maligno, acepta el reto de destruir el mundo, esos heroes tendran que unir sus fuerzas por primera vez para proteger las esperanzas, las creencias y la imaginación de los ninos de todo el mundo.', '2012-11-24', '100', 10, 1, 'copia_de_rise.jpg', 'rise.jpg', '', 'http://www.youtube.com/watch?v=fI31Qsmp7iM', 0.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(63, 'Que Esperar cuando estas Esperando', 'What to expect when you''re expecting', 'La pelicula sigue la vida de cuatro parejas mientras se preparan para ser padres, entre las que se encuentran las actrices Cameron Diaz, Jennifer Lopez, y Brooklyn Decker. Basada en el best-seller "Qué se puede esperar cuando se esta esperando" que ha vendido mas de 16 millones de copias, esta pelicula es una comedia romantica del estilo de Love Actually o el Dia de San Valentin. La pelicula es una vision moderna de amor a traves de los ojos de cuatro parejas interconectadas experimentando la em', '2012-11-23', '110', 3, 1, 'what-to-expect-when-youre-expecting-pal_movie-poster.jpg', 'copia_de_what-to-expect-when-youre-expecting-pal_movie-poster.jpg', '', 'http://www.youtube.com/watch?v=hWBYkFAhBmE', 0.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(64, 'Tour Cine Frances', 'French Tour', 'Este 2011, el 15 TOUR DE CINE FRANCES, sera testigo de 7 peliculas francesas de reciente produccion, que recorreran el pais a los largo de mas de 50 ciudades. Se exhibirian durante dos semana por ciudad y su gira en la Republica dura del 09 de septiembre al 01 de diciembre. La cereza del pastel esta a cargo de la proyeccion anes de cada pelicula de uno de los 14 cortometrajes mexicanos producidos por el IMCINE en 2011.', '2012-11-23', '140', 12, 0, 'copia_de_20110907_frances-261x300.jpg', '20110907_frances-261x300.jpg', '', 'http://www.youtube.com/watch?v=pafxtKYHjAE', 0.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(65, 'Busqueda Implacable', 'Taken 2', 'Aunque ya esta retirado, Bryan Mills (Liam Neeson) se ve obligado a utilizar todos sus recursos y habilidades de agente de la CIA para salvar tanto la vida de su mujer y de su hija como la suya propia. El padre de uno de los secuestradores albaneses que lo tuvieron en jaque en el primer film jura vengarse y aprovecha las vacaciones de la familia Mills en Estambul para llevar a cabo su plan. Una vez mas parece que subestiman al ex agente de la CIA.', '2012-11-30', '95', 4, 1, 'taken2-300x300_-_copia.jpg', 'taken2-300x300.jpg', '', 'http://www.youtube.com/watch?v=4ci7E9hKGwc', 5.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(66, 'Argo', 'Argo', 'Basado en hechos reales. Iran, ano 1979. Cuando la embajada de los Estados Unidos en Teheran es ocupada por seguidores del ayatola Jomeini para pedir la extradicion del Sha de Persia, la CIA y el gobierno canadiense organizaron una operacion para rescatar a seis diplomaticos estadounidenses que se habian refugiado en la casa del embajador de Canada. Con este fin se recurrio a un experto en rescatar rehenes y se preparo el escenario para el rodaje de una pelicula de ciencia-ficcion, de titulo "Ar', '2012-11-30', '120', 13, 1, 'argo_-_copia.jpg', 'argo.jpg', '', 'http://www.youtube.com/watch?v=ruH1nAQhjI0', 0.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(67, 'Origen de los Guardianes', 'Rise of the Guardians', 'Los Guardianes Inmortales son un grupo de heroes que poseen extraordinarias facultades. Cuando Pitch, un espiritu maligno, acepta el reto de destruir el mundo, esos heroes tendran que unir sus fuerzas por primera vez para proteger las esperanzas, las creencias y la imaginacion de los ninos de todo el mundo.', '2012-11-30', '100', 11, 1, 'hr_rise_of_the_guardians_19-300x300_-_copia.jpg', 'hr_rise_of_the_guardians_19-300x300.jpg', '', 'http://www.youtube.com/watch?v=fI31Qsmp7iM', 0.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(68, 'Hotel Transilvania', 'Hotel Transylvania', 'Desde su nacimiento, Mavis vive en el lujoso hotel Transylvania, que fue creado para proteger a los monstruos de la amenaza de los seres humanos. Cuando Mavis esta a punto de cumplir la mayoria de edad (118 anos), su padre, el conde Dracula, le prepara una fiesta a la que acuden los mejores amigos de la familia: desde Frankenstein al Hombre Invisible o la Momia; pero tambien asiste a la celebracion un hombre que se enamora de Mavis.', '2012-12-07', '90', 11, 1, 'transil.jpg', 'copia_de_transil.jpg', '', 'http://www.youtube.com/watch?v=NlnrbAiiHuM', 0.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(69, 'Amigos del 3 Tipo', 'The Watch', 'Tras el asesinato de uno de los vecinos de un barrio, se crea una patrulla de vigilancia que acabara descubriendo una trama alienigena para destruir el mundo.', '2012-12-07', '100', 3, 1, 'copia_de_thewatch.jpg', 'thewatch.jpg', '', 'http://www.youtube.com/watch?v=c5FzAXEilpU', 5.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(70, 'El Hobbit', 'The Hobbit', 'Precuela de la trilogia "El Senor de los Anillos", obra de J.R.R. Tolkien. En compania del mago Gandalf y de trece enanos, el hobbit Bilbo Bolson emprende un viaje a traves del pais de los elfos y los bosques de los trolls, desde las mazmorras de los orcos hasta la Montana Solitaria, donde el dragon Smaug esconde el tesoro de los Enanos. Finalmente, en las profundidades de la Tierra, encuentra el Anillo Unico, hipnotico objeto que sera posteriormente causa de tantas sangrientas batallas en la Ti', '2012-12-14', '170', 5, 1, 'el-hobbit-banda-sonora-de-la-pelicula-portada-300x300.jpg', 'copia_de_el-hobbit-banda-sonora-de-la-pelicula-portada-300x300.jpg', '', 'http://youtu.be/vZnj01Fe06Q', 5.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(71, 'Ralph El Demoledor.', 'Wreck-It-Ralph', 'Ralph, un villano de un videojuego de 8-bits, aspira a ser un heroe. Para conseguirlo, se escapa de su videojuego y entra en otros juegos dentro del arcade.', '2012-12-21', '100', 11, 1, 'wreck.jpg', 'copia_de_wreck.jpg', '', 'http://youtu.be/gNrpuuZHXK4', 3.50, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(72, 'Una Aventura Extraordinaria', 'Life of Pi', 'Tras un naufragio en medio del oceano Pacifico, el joven hindu Pi, hijo de un guarda de zoo que viajaba de la India a Canada, se encuentra en un bote salvavidas con un unico superviviente, un tigre de bengala con quien labrara una emocionante, increible e inesperada relacion.', '2012-12-28', '130', 2, 1, 'copia_de_life_of_pi.jpg', 'life_of_pi.jpg', '', 'http://www.youtube.com/watch?v=qcSs_K_G10o', 3.50, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(73, 'Bajo la Mira', 'Jack Reacher', 'Jack Reacher, un antiguo policia militar que vive como un vagabundo y trabaja por su cuenta, decide investigar el caso de un francotirador que ha sido acusado de matar, por puro azar, a cinco personas en un tiroteo.', '2012-12-28', '130', 4, 1, 'jackreacher.jpg', 'copia_de_jackreacher.jpg', '', 'http://www.youtube.com/watch?v=CQWE3shrOEE', 5.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(74, 'Amenaza Roja', 'Red Dawn', 'Amenaza Roja (Red Dawn) se centra en una supuesta tercera Guerra Mundial en la que un pais extranjero invade suelo norteamericano y un grupo de adolescentes intentara salvar su ciudad.', '2013-01-04', '107', 4, 1, 'copia_de_reddawn.jpg', 'reddawn.jpg', '', 'http://www.youtube.com/watch?v=lXVQ8rWo8wc', 0.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(75, 'La Cabana del Terror', 'The Cabin in the Woods', 'Cinco amigos deciden pasar unos dias de descanso fuera de la ciudad en una apartada cabana en el bosque, sin imaginar que lo estan a punto de vivir pondra en riesgo sus vidas. Juntos, deberan descubrir la verdad que se oculta detras de la cabana del terror… si es que logran mantenerse a salvo.', '2013-01-04', '95', 6, 1, 'copia_de_cabin.jpg', 'cabin.jpg', '', 'http://www.youtube.com/watch?v=SsfR5F32PCg', 3.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(76, 'S.O.S Familia en Apuros', 'Parental Guidance', 'Mientras su hija trabaja, un abuelo tiene que hacerse cargo de sus tres nietos. El problema consiste en que debe cuidarlos siguiendo metodos del siglo XXI con los que no esta en absoluto de acuerdo, por lo que acabara educandolos a la vieja usanza.', '2013-01-18', '100', 3, 1, 'copia_de_51tdfqw0obl._sl500_aa300_.jpg', '51tdfqw0obl._sl500_aa300_.jpg', '', 'http://youtu.be/D5zah8Yo07c', 4.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(77, 'Siniestro', 'Sinister', 'Un periodista viaja con su familia a lo largo y ancho del pais para investigar terribles asesinatos que luego convierte en libros. Cuando llega a una casa donde ha tenido lugar el asesinato de una familia, encuentra una cinta que desvela horribles pistas que van mas alla del esclarecimiento de la tragedia.', '2013-01-18', '110', 9, 1, 'sinister.jpg', 'copia_de_sinister.jpg', '', 'http://youtu.be/GSek_rUCx1o', 4.75, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(78, 'Curvas de la Vida', 'Trouble with the Curve', 'Un veterano ojeador de beisbol de edad avanzada (Clint Eastwood), que esta perdiendo poco a poco la vista, viaja con su hija (Amy Adams) hasta Atlanta para observar a un joven talento. Las relaciones entre padre e hija son bastante conflictivas. Convincente retrato de la vejez y de su progresivo aislamiento respecto a las nuevas generaciones. Debut en la direccion de Robert Lorenz, ayudante de direccion de Eastwood, con quien trabajo en ''Los puentes de Madison'', ''Mystic River'' y ''Million Dollar', '2013-01-18', '110', 2, 1, 'trouble.jpg', 'copia_de_trouble.jpg', '', 'http://youtu.be/7kGc5onmaUE', 3.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(79, 'Sammy', 'Around the world in 50 years', 'Sammy nace junto a sus hermanos en una hermosa playa y se enfrenta a la lucha por su supervivencia, para llegar a convertirse en una tortuga adulta y asi, en la madurez, regresar a la playa donde nació para reproducirse. La busqueda de una companera le hara enfrentarse a nuevas situaciones, pero a pesar de las mareas negras y otras complicaciones alcanzara su objetivo, llegar a la playa que le vio nacer, tras recorrer el mundo, y dar paso a una nueva generacion.', '2013-01-11', '88', 11, 0, 'las-aventuras-de-sammy.jpg', 'copia_de_las-aventuras-de-sammy.jpg', '', 'http://youtu.be/dXt9EwTdDNI', 1.50, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(80, 'Hansel y Gretel', 'Hansel and Gretel Witch Hunters', 'Hansel y Gretel, 15 anos despues de los hechos narrados en el popular cuento de hadas de los Hermanos Grimm, se ganan la vida cazando y aniquilando brujas de forma violenta.', '2013-01-25', '90', 13, 1, '51goguudbvl._sl500_aa300_.jpg', '51goguudbvl._sl500_aa300__-_copia.jpg', '', 'http://youtu.be/2sYngYYVNmE', 3.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(81, '¿Quien paga la cuenta?', 'Quien paga la cuenta?', 'Bienvenidos a un mundo donde hay muchas deudas que pagar, dinero por cobrar, enredos que aclarar y una gran incognita que Dora, Saul y Salvador deberan responder... ¿QUIEN PAGA LA CUENTA?', '2013-01-25', '110', 3, 1, 'quien_paga_la_cuenta_copia.jpg', 'quien_paga_la_cuenta.jpg', '', 'http://youtu.be/hKoRhM5AbZU', 4.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(82, '12 Horas', 'Gone', 'En 12 horas, Jill Parrish (Amanda Seyfried) regresa a su casa despues de un turno de noche, cuando encuentra la cama de su hermana vacia. Ella no esta en casa, y Jill esta convencida de que su hermana ha sido secuestrada por el mismo asesino en serie que dos anos atras la secuestro y atormento a ella.', '2013-01-25', '94', 13, 1, 'gone-2012-soundtrack.jpg', 'gone-2012-soundtrack_-_copia.jpg', '', 'http://www.youtube.com/watch?v=um9DkfxiKFM', 4.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(83, 'Lincoln', 'Lincoln', 'En 1865, mientras la Guerra Civil Americana se acerca a su fin, el presidente Abraham Lincoln propone la instauracion de una enmienda que prohiba la esclavitud en los Estados Unidos. Sin embargo esto presenta un gran dilema: si la paz llega antes de que se acepte la enmienda, el Sur tendra poder para rechazarla y mantener la esclavitud; si la paz llega despues, cientos de personas seguiran muriendo en el frente. En una carrera contrarreloj para conseguir los votos necesarios, Lincoln se enfrenta', '2013-02-01', '150', 2, 1, 'lin.jpg', 'copia_de_lin.jpg', '', 'http://youtu.be/bKCpERS_mq8', 3.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(84, 'Monsters Inc 3D', 'Monsters Inc 3D', 'Monsters Inc. es la mayor empresa de miedo del mundo, y James P. Sullivan es uno de sus mejores empleados. Asustar a los ninos no es un trabajo facil, ya que todos creen que los ninos son toxicos y no pueden tener contacto con ellos. Pero un dia una nina se cuela sin querer en la empresa, provocando el caos.', '2013-02-01', '95', 11, 1, 'mons.jpg', 'copia_de_mons.jpg', '', 'http://youtu.be/6tCxnHCqqxg', 5.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(85, 'Plan Perfecto', 'Friends with Kids', 'Comedia que narra la historia de un circulo de amigos en el momento en que la llegada de los hijos cambia todo en sus vidas. Los dos ultimos solteros de la panda de amigos, conscientes de lo que acarrea tener un nino, deciden tener un hijo juntos pero seguir saliendo con otras personas.', '2013-02-01', '107', 3, 1, 'copia_de_frie.jpg', 'frie.jpg', '', 'http://youtu.be/sZZfD8eFIqE', 0.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(86, 'Hit and Run', 'Hit and Run', 'La pelicula se centra en un ex-piloto de fugas (Shepard) que evade el programa de proteccion de testigos con el fin de llevar a su novia (Bell) a Los Angeles para que esta pueda hacerse con el trabajo de su vida. Sin embargo, tanto las autoridades pertinentes como los integrantes de su antigua banda, comandados por el personaje de Cooper, se enteraran de su reaparicion en la escena publica y y dara comienzo a una persecucion sin freno.', '2013-02-01', '100', 4, 1, 'copia_de_hit.jpg', 'hit.jpg', '', 'http://youtu.be/9FyKg1w23Rc', 0.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(87, 'Asesinos del Futuro', 'Looper', 'Looper es film ambientado en un futuro en el que el viaje en el tiempo ha sido inventado y un grupo de personas son encargadas de viajar al dia de hoy para acabar con criminales.', '2013-02-08', '118', 4, 1, 'looper_afiche_-_copia.jpg', 'looper_afiche.jpg', '', 'http://youtu.be/jlIuGNtSqls', 4.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(88, 'El Maestro Luchador', 'Here comes the Boom', 'Scott Voss, un antiguo luchador universitario, es ahora un maestro de biologia en una deteriorada preparatoria. Cuando los recortes presupuestales amenazan con cancelar el programa de musica y despedir al encargado, Scott empieza a recaudar dinero trabajando en su tiempo libre como luchador de artes marciales mixtas. Todos piensan que Scott esta loco, sobre todo Bella, la enfermera escolar. Pero a medida que se compromete cada vez mas en su mision de luchar por los alumnos, se convierte en una s', '2013-02-08', '105', 3, 1, 'here_comes_the_boom_-_copia.jpg', 'here_comes_the_boom.jpg', '', 'http://youtu.be/4J1O7ZSpdAo', 4.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(89, 'Las aventuras de Tadeo Jones', 'Tad, the Lost Explorer', 'Tadeo es un albanil espanol que es confundido con un famoso arqueologo y reclutado, contra su voluntad, para una peligrosa mision que tendra que realizar en Peru. El objetivo es evitar que una ambiciosa corporacion desvalije la mitica Ciudad Perdida de los incas. Afortunadamente, Tadeo no esta solo: le acompana su fiel perro Jeff, una valiente profesora, un loro mudo y un buscavidas.', '2013-02-08', '85', 5, 1, 'las-aventuras-de-tadeo-jones-196197_(1).jpg', 'las-aventuras-de-tadeo-jones-196197.jpg', '', 'http://youtu.be/6Dbo7y1ZOTY', 1.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(90, 'Monsters Inc 3D', 'Monsters Inc 3D', 'Monsters es la mayor empresa de miedo del mundo de los monstruos y James P. Sullivan es uno de sus mejores Asustadores. Sullivan es un imponente personaje recubierto de piel azul con lunares de color violeta que luce dos cuernos, y al que sus amigos llaman Sulley. Mike Wazowski, su Ayudante Asustador, ademas de su mejor amigo y companero de habitacion, es un monstruo verde, testarudo, tuerto y muy divertido.', '2013-02-08', '92', 5, 1, 'monster_inc_-_copia.jpg', 'monster_inc.jpg', '', 'http://youtu.be/oat9QQnOQvQ', 0.00, 'Todo Publico');
INSERT INTO `pal_movie` VALUES(91, 'Sin Salida', 'Trespass', 'Kyle y Sarah son un adinerado matrimonio que creia tener la vida perfecta, hasta que son secuestrados en su propia casa por unos delincuentes que no solo saben lo que tienen, sino que tambien conocen secretos que ni siquiera Kyle y Sarah se habian atrevido a confesar', '2013-02-08', '01', 4, 1, 'trespass-poster-d2bdb-480x711_-_copia.jpg', 'trespass-poster-d2bdb-480x711.jpg', '', 'http://youtu.be/i9s7bKHzwSs', 0.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(92, 'Duro de Matar 5', 'A Good Day to Die Hard', 'John McLane, volvera a meterse en lios en la quinta entregan de Duro de matar. John Moore (Max Payne) sera el encargado de dirigir las nuevas aventuras del emblematico personaje interpretado por Bruce Willis, que esta vez le llevaran junto con su hijo a Rusia.', '2013-02-15', '97', 4, 1, 'duro_de_matar_5_-_copia.jpg', 'duro-de-matar-un-buen-dia-para-morir-5075ch(1).jpg', 'duro-de-matar-un-buen-dia-para-morir-5075ch(1).jpg', 'www.youtu.be/i9_yiaSSQTo', 3.75, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(93, 'Los Miserables', 'Les Miserables', 'LOS MISERABLES transcurre en la Francia del siglo XIX y cuenta una emotiva historia de suenos rotos, amor no correspondido, pasion, sacrificio y redencion: una prueba atemporal de la fuerza del espiritu humano. Hugh Jackman es Jean Valjean, el exconvicto al que persigue durante decadas el despiadado policia Javert (Russell Crowe) despues de saltarse la condicional. Cuando Valjean accede a cuidar a Cosette, la joven hija de Fantine (Anne Hathaway), sus vidas cambiaran para siempre.', '2013-02-15', '157', 2, 1, 'descarga_-_copia.jpg', 'descarga.jpg', '', 'http://www.youtu.be/aR6iVDBuPq0', 0.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(94, 'La Noche Mas Oscura', 'Zero Dark Thirty', 'La captura de Osama bin Laden preocupo al mundo y a dos administraciones presidenciales estadounidenses durante mas de una decada. Al final, un pequeno y brillante grupo de agentes de la CIA le encontro. Fue una mision llevada en el secreto mas absoluto. Algunos detalles han salido a la luz, pero las partes mas significativas de la operacion secreta, y sobre todo el papel que jugo el equipo de agentes, se veran por primera vez.', '2013-02-22', '157', 4, 1, 'untitled_-_copia_(2).bmp', 'untitled_-_copia.bmp', 'untitled.bmp', 'http://www.youtu.be/oISVuYjpigU', 5.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(95, 'DJANGO sin cadenas', 'Django Unchained', 'Ambientanda en el Sur, dos anos antes de la Guerra Civil, en Django sin cadenas un esclavo cuya brutal historia con sus antiguos duenos lo lleva a enfrentarse cara a cara con el cazador de recompensas aleman, el Dr. King Schultz.', '2013-02-22', '165', 13, 1, 'imagescairi05z_-_copia_(2).jpg', 'imagescairi05z_-_copia.jpg', 'imagescairi05z.jpg', 'http://www.youtu.be/eUdM9vrCbow', 1.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(96, 'Lo imposible', 'The Impossible', 'Maria, Henry y sus tres hijos comienzan sus vacaciones de invierno en Tailandia en busca de unos dias en un paraiso tropical. Pero en la mañana del 26 de Diciembre, mientras disfrutan de sus relajantes vacaciones en la piscina tras la celebracion de la Navidad y Nochebuena, un terrible rugido emerge del centro de la tierra. Mientras Maria se paraliza de miedo, un inmenso muro de agua oscura corre por los jardines del hotel hacia ella. Largometraje sobre el tsunami que azoto el sudeste asiático e', '2013-03-01', '107', 2, 1, 'the_impossible_album_cover_art.200x200-75.jpg', 'the_impossible_album_cover_art.200x200-75.jpg', 'the_impossible_album_cover_art.200x200-75.jpg', 'http://www.youtu.be/PkIM7uwJ3Eg', 4.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(97, 'El Vuelo', 'Flight', 'El vuelo SouthJet 227 despega de Orlando (Florida), iniciando lo que deberia haber sido un trayecto rutinario. El capitan Whip Whitaker esta al mando del Jackson-Ridgefield 88 Passenger Jet junto a su joven y formal co-piloto y su primer oficial Ken Evans, que es el polo opuesto de Whip en todos los sentidos. El vuelo no tarda en toparse con turbulencias mucho mas violentas de lo esperado segun se adentran en una tormenta inmensa. No resulta un problema para Whip que dirige el avión a un claro,', '2013-03-01', '138', 2, 1, 'descarga_-_copia_(2).jpg', 'descarga_-_copia(1).jpg', 'descarga.jpg', 'http://www.youtu.be/ek3iJW6yc2g', 3.00, 'Mayores de 15');
INSERT INTO `pal_movie` VALUES(98, 'Hitchcock', 'Hitchcock', 'Alfred Hitchcock fue uno de los directores de cine clasico mas influyentes y personales. Su estilo, basado en el genero de la intriga, atrajo por igual al publico y a la critica. En este biopic dirigido por Sacha Gervasi, el gran Anthony Hopkins se mete literalmente en la piel de Hitchcock durante el rodaje de una de sus obras maestras: Psicosis.', '2013-03-01', '98', 2, 1, 'descarga_(2)_-_copia.jpg', 'descarga_(1).jpg', 'descarga_(2)_-_copia.jpg', 'http://www.youtu.be/5OVKVWu_d7E', 2.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(99, 'G.I Joe', 'G.I Joe Retaliation', 'En esta secuela, los G.I Joes no solo tendrán que luchar contra su enemigo mortal, Cobra, sino que además se verán obligados a lidiar con las amenazas de dentro del gobierno que ponen en peligro su propia existencia.', '2012-03-28', '110', 4, 1, 'tt1583421.jpeg', 'tt1583421.jpeg', 'tt1583421.jpeg', 'www.youtu.be/ek3iJW6yc2g', 0.00, 'Mayores de 13');
INSERT INTO `pal_movie` VALUES(100, 'El Conjuro', 'the conjuring', 'Los investigadores paranormales Ed y Lorraine Warren ayudan a una familia aterrorizada por una presencia maligna en su granja. Obligados a confrontar un espíritu muy poderoso, los Warren se encuentran con el caso más aterrador de sus vidas.', '2013-08-28', '120 min', 6, 0, 'conjuro.jpg', 'conju_min(1).jpg', 'conju_min.jpg', 'http://www.youtube.com/watch?v=OJgDCNyfWfQ', 0.00, 'Mayores de 15');
